I find a performance test very difficult to judge since typically loading and saving is a one shot :
* the hotspot compiler has not much time for compilation
* the file will be read physical from disk when i start eclipse in the morning. - but from RAM if i restart eclipse.

I took a single large real life project with a 170MB sized state.dat (which did read in ~1.2sec and writes in .7sec) and run:

package org.eclipse.jdt.core.tests.builder;

import java.io.BufferedInputStream;
import java.io.BufferedOutputStream;
import java.io.DataInputStream;
import java.io.DataOutputStream;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import java.util.zip.ZipException;

import org.eclipse.core.resources.IProject;
import org.eclipse.core.runtime.CoreException;
import org.eclipse.core.runtime.IPath;
import org.eclipse.jdt.core.JavaCore;
import org.eclipse.jdt.core.JavaModelException;
import org.eclipse.jdt.internal.core.builder.JavaBuilder;
import org.eclipse.jdt.internal.core.builder.State;
import junit.framework.Test;

public class StatePerfromanceTest extends BuilderTests {

	private static final String PROJET_NAME = "com.wamas.world.datasetup";

	public StatePerfromanceTest(String name) {
		super(name);
	}

	public static Test suite() {
		return buildTestSuite(StatePerfromanceTest.class);
	}

	public void testWriteAndReadStateZip() throws JavaModelException, Exception {
		long sum = 0;
		for (int i = 0; i < 4; i++) {
			IPath orojectPath = env.addProject(PROJET_NAME);
			long n0 = System.nanoTime();
			readAndWriteState(orojectPath, ".zip");
			long n1 = System.nanoTime();
			System.out.println("zip total:" + (n1 - n0) / 1_000_000 + "ms\n");
			sum += (n1 - n0);
			env.removeProject(orojectPath);
		}
		System.out.println("zip sum:" + sum / 1_000_000 + "ms\n\n");
	}

	public void testWriteAndReadState() throws JavaModelException, Exception {
		long sum = 0;
		for (int i = 0; i < 4; i++) {
			IPath orojectPath = env.addProject(PROJET_NAME);
			long n0 = System.nanoTime();
			readAndWriteState(orojectPath, "");
			long n1 = System.nanoTime();
			System.out.println("raw total:" + (n1 - n0) / 1_000_000 + "ms\n");
			sum += (n1 - n0);
			env.removeProject(orojectPath);
		}
		System.out.println("raw sum:" + sum / 1_000_000 + "ms\n\n");
	}

	private void readAndWriteState(IPath projectPath, String suffix)
			throws JavaModelException, IOException, CoreException {
		IProject project = env.getProject(projectPath);
		File readFile = new File("C:/temp/com.wamas.world.datasetup/state.dat" + suffix);
		File writeFile = new File("C:/temp/state.dat" + suffix);
		State readState = null;
		try (DataInputStream in = new DataInputStream(
				readFile.toString().endsWith("zip") ? createInputStreamZip(readFile) : createInputStream(readFile))) {
			long n0 = System.nanoTime();
			String pluginID = in.readUTF();
			String kind = in.readUTF();
			if (in.readBoolean()) {
				readState = JavaBuilder.readState(project, in);
			}
			long n1 = System.nanoTime();
			System.out.println("read:" + (n1 - n0) / 1_000_000 + "ms");
		}
		try (DataOutputStream out = new DataOutputStream(
				writeFile.toString().endsWith("zip") ? createOutputStreamZip(writeFile)
						: createOutputStream(writeFile))) {
			long n0 = System.nanoTime();
			out.writeUTF(JavaCore.PLUGIN_ID);
			out.writeUTF("STATE"); //$NON-NLS-1$
			out.writeBoolean(true);
			JavaBuilder.writeState(readState, out);
			long n1 = System.nanoTime();
			System.out.println("write:" + (n1 - n0) / 1_000_000 + "ms");
		}

	}

	private InputStream createInputStreamZip(File file) throws IOException {
		InputStream in = new FileInputStream(file);
		try {
			return new BufferedInputStream(new java.util.zip.GZIPInputStream(in, 8192));
		} catch (ZipException e) {
			// probably not zipped (old format).
			in.close();
			return new BufferedInputStream(new FileInputStream(file));
		}
	}

	private OutputStream createOutputStreamZip(File file) throws IOException {
		return new BufferedOutputStream(new java.util.zip.GZIPOutputStream(new FileOutputStream(file), 8192));
	}

	private InputStream createInputStream(File file) throws IOException {
		BufferedInputStream in = new BufferedInputStream(new FileInputStream(file));
		return in;
	}

	private OutputStream createOutputStream(File file) throws IOException {
		return new BufferedOutputStream(new FileOutputStream(file));
	}
}


