WeakHashSet (unsynchronized) vs (synchronized) DeduplicationUtil => almost no overhead in JDK 11, 20% overhead in jdk 17 (they changed synchronize).

package benchmarks.file;

import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

import org.openjdk.jmh.annotations.Benchmark;
import org.openjdk.jmh.annotations.BenchmarkMode;
import org.openjdk.jmh.annotations.Fork;
import org.openjdk.jmh.annotations.Measurement;
import org.openjdk.jmh.annotations.OutputTimeUnit;
import org.openjdk.jmh.annotations.Setup;
import org.openjdk.jmh.annotations.State;
import org.openjdk.jmh.annotations.TearDown;
import org.openjdk.jmh.runner.Runner;
import org.openjdk.jmh.runner.RunnerException;
import org.openjdk.jmh.runner.options.Options;
import org.openjdk.jmh.runner.options.OptionsBuilder;

//no warm up, because load/safe also happens only a single time
@BenchmarkMode(org.openjdk.jmh.annotations.Mode.SingleShotTime)
@OutputTimeUnit(java.util.concurrent.TimeUnit.MILLISECONDS)
@State(org.openjdk.jmh.annotations.Scope.Thread)
@Fork(value = 1, jvmArgsAppend = "-ea")
// iterations like number of projects 
@Measurement(batchSize = 1, timeUnit = java.util.concurrent.TimeUnit.MILLISECONDS, iterations = 50)
public class Deduplication {
	private static final int DISTINCT = 10000;
	private static final int REPEATS = 100;
	List<String> values;
	List<String> deduplicated;
	List<char[]> valueChars;
	List<char[]> deduplicatedChars;

	@Setup
	public void setup() throws IOException {
		values = new ArrayList<>();
		valueChars = new ArrayList<>();
		for (int k = 0; k < REPEATS; k++) {
			for (int i = 0; i < DISTINCT; i++) {
				String s = "blablahblah_something_long(qualified_package_name)" + i;
				values.add(s);
				valueChars.add(s.toCharArray());
			}
		}
		deduplicated = null;
		deduplicatedChars = null;
	}

	@TearDown
	public void test() throws IOException {
		{
			int different = values.size();
			assert different > DISTINCT;
		}
		{
			int different = valueChars.size();
			assert different > DISTINCT;
		}
		assert deduplicated != null || deduplicatedChars != null;
		if (deduplicated != null) {
			int distinct = countDistinct(deduplicated);
			assert distinct == DISTINCT;
		}
		if (deduplicatedChars != null) {
			int distinct = countDistinct(deduplicatedChars);
			assert distinct == DISTINCT;
		}
	}

	static class SameInstance {
		private Object o;

		SameInstance(Object o) {
			this.o = o;
		}

		@Override
		public boolean equals(Object obj) {
			return ((SameInstance) obj).o == this.o;
		}

		@Override
		public int hashCode() {
			return System.identityHashCode(o);
		}
	}

	private int countDistinct(List<?> list) {
		return (int) list.stream().map(SameInstance::new).distinct().count();
	}

	@Benchmark
	public void HashMap() throws IOException {//
		deduplicated = new ArrayList<>();
		java.util.HashMap<String, String> map = new java.util.HashMap<>();
		for (String s : values) {
			String previous = map.putIfAbsent(s, s);
			String d = previous == null ? s : previous;
			deduplicated.add(d);
		}
	}

	@Benchmark
	public void ConcurrentHashMap() throws IOException {//
		deduplicated = new ArrayList<>();
		java.util.concurrent.ConcurrentHashMap<String, String> map = new java.util.concurrent.ConcurrentHashMap<>();
		for (String s : values) {
			String previous = map.putIfAbsent(s, s);
			String d = previous == null ? s : previous;
			deduplicated.add(d);
		}
	}

	@Benchmark
	public void DeduplicationUtil() throws IOException {//
		deduplicated = new ArrayList<>();
		for (String s : values) {
			String d = org.eclipse.jdt.internal.core.util.DeduplicationUtil.intern(s);
			deduplicated.add(d);
		}
	}

	@Benchmark
	public void charDeduplicationUtil() throws IOException {//
		deduplicatedChars = new ArrayList<>();
		for (char[] s : valueChars) {
			char[] d = org.eclipse.jdt.internal.core.util.DeduplicationUtil.intern(s);
			deduplicatedChars.add(d);
		}
	}

	@Benchmark
	public void WeakHashSet() throws IOException {//
		deduplicated = new ArrayList<>();
		org.eclipse.jdt.internal.core.util.WeakHashSet<String> map = new org.eclipse.jdt.internal.core.util.WeakHashSet<>();
		for (String s : values) {
			String d = map.add(s);
			deduplicated.add(d);
		}
	}
	@Benchmark
	public void intern() throws IOException {//
		deduplicated = new ArrayList<>();
		for (String s : values) {
			String d = s.intern();
			deduplicated.add(d);
		}
	}

	public static void main(String[] args) throws RunnerException {
		Options opt = new OptionsBuilder().include(Deduplication.class.getSimpleName()).shouldFailOnError(true).build();
		new Runner(opt).run();
	}

}

